import React from 'react';
import TrainerCover from './TrainerCover/TrainerCover';
// import getTrainers from '../../trainers-get';

export default function Trainers() {
    return (
        <div className='container'>
            {
                getTrainers().map(trainerCover => (
                    <TrainerCover 
                        key={trainerCover.id}
                        id={trainerCover.id}
                        firstname={trainerCover.firstname}
                        lastname={trainerCover.lastname}
                        trainerImage={trainerCover.trainerImage}
                    />
                ))
            }
      </div>
    );
}



